  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BR9 //g
  			str		r3, [r2]
  			b		endcase

  		case2_1:
  			cmp r5, #0x2
  			bne		case3_1
  			ldr		r3, =GPIO_BSRR_BS2 //a
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS3 //b
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BR4 //c
