  			ldr		r3, =GPIO_BSRR_BS9 //g
  			str		r3, [r2]
  			b		endcase

  		case3_1:

  			cmp r5, #0x3
  			bne		case4_1
  			ldr		r3, =GPIO_BSRR_BS2 //a
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS3 //b
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS4 //c
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS5 //d
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BR6 //e
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BR8 //f
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS9 //g
  			str		r3, [r2]
  			b		endcase

  		case4_1:
  			cmp r5, #0x4
  			bne		case5_1
  			ldr		r3, =GPIO_BSRR_BR2  //a
  			str		r3, [r2]
  			ldr		r3, =GPIO_BSRR_BS3 //b
